g__not_in";a:0:{}s:8:"tag__and";a:0:{}s:12:"tag_slug__in";a:0:{}s:13:"tag_slug__and";a:0:{}s:15:"post_parent__in";a:0:{}s:19:"post_parent__not_in";a:0:{}s:10:"author__in";a:0:{}s:14:"author__not_in";a:0:{}s:16:"suppress_filters";b:0;s:13:"cache_results";b:1;s:22:"update_post_term_cache";b:1;s:19:"lazy_load_term_meta";b:1;s:22:"update_post_meta_cache";b:1;s:8:"nopaging";b:0;s:17:"comments_per_page";s:2:"50";s:13:"no_found_rows";b:0;s:8:"taxonomy";s:18:"product_visibility";s:7:"term_id";s:8:"featured";}s:9:"tax_query";O:12:"WP_Tax_Query":6:{s:7:"queries";a:2:{i:0;a:5:{s:8:"taxonomy";s:18:"product_visibility";s:5:"terms";a:2:{i:0;i:7;i:1;i:9;}s:5:"field";s:16:"term_taxonomy_id";s:8:"operator";s:6:"NOT IN";s:16:"include_children";b:1;}i:1;a:5:{s:8:"taxonomy";s:18:"product_visibility";s:5:"terms";a:1:{i:0;s:8:"featured";}s:5:"field";s:4:"name";s:8:"operator";s:2:"IN";s:16:"include_children";b:1;}}s:8:"relation";s:3:"AND";s:16:"\0*\0table_aliases";a:1:{i:0;s:23:"wpl9_term_relationships";}s:13:"queried_terms";a:1:{s:18:"product_visibility";a:2:{s:5:"terms";a:1:{i:0;s:8:"featured";}s:5:"field";s:4:"name";}}s:13:"primary_table";s:10:"wpl9_posts";s:17:"primary_id_column";s:2:"ID";}s:10:"meta_query";O:13:"WP_Meta_Query":9:{s:7:"queries";a:0:{}s:8:"relation";N;s:10:"meta_table";N;s:14:"meta_id_column";N;s:13:"primary_table";N;s:17:"primary_id_column";N;s:16:"\0*\0table_aliases";a:0:{}s:10:"\0*\0clauses";a:0:{}s:18:"\0*\0has_or_relation";b:0;}s:10:"date_query";b:0;s:7:"request";s:498:"SELECT SQL_CALC_FOUND_ROWS  wpl9_posts.ID FROM wpl9_posts  LEFT JOIN wpl9_term_relationships ON (wpl9_posts.ID = wpl9_term_relationships.object_id) WHERE 1=1  AND ( \n  wpl9_posts.ID NOT IN (\r\n				SELECT object_id\r\n				FROM wpl9_term_relationships\r\n				WHERE term_taxonomy_id IN (7,9)\r\n			) \n  AND \n  wpl9_term_relationships.term_taxonomy_id IN (8)\n) AND wpl9_posts.post_type = ''product'' AND ((wpl9_posts.post_status = ''publish'')) GROUP BY wpl9_posts.ID ORDER BY wpl9_posts.post_date DESC LIMIT 0, 2";s:5:"posts";a:2:{i:0;O:7:"WP_Post":24:{s:2:"ID";i:57;s:11:"post_author";s:1:"1";s:9:"post_date";s:19:"2017-10-03 11:10:36";s:13:"post_date_gmt";s:19:"2017-10-03 11:10:36";s:12:"post_content";s:682:"Hermosa habitaci?n que evoca una ?poca de a?oranza, donde sus detalles en madera, friso sobado y caico se funden con el paisaje haci?ndolo disfrutar una c?lida estad?a rodeado de m?gicos escenarios, con una capacidad m?xima de hasta 3 personas.\r\n<table class="table table-striped mt30">\r\n<tbody>\r\n<tr>\r\n<td><i class="fa fa-check-circle"></i>?1 Cama matrimonial.</td>\r\n<td><i class="fa fa-check-circle"></i>?1 Sofa cama individual.</td>\r\n<td><i class="fa fa-check-circle"></i>?1 Ba?o</td>\r\n</tr>\r\n<tr>\r\n<td><i class="fa fa-check-circle"></i>?Calefacci?n</td>\r\n<td><i class="fa fa-check-circle"></i>?Desayuno Incluido</td>\r\n<td></td>\r\n</tr>\r\n<tr>\r\n<td></td>\r\n</tr>\r\n</tbody>\r\n</table>";s:10:"post_title";s:20:"Matrimonial Colonial";s:12:"post_excerpt";s:117:"Capacidad Maxima: 3 personas\r\n\r\n1 persona: Bs. 115.812,50\r\n\r\n2 personas: Bs. 165.446,43\r\n\r\n3 personas: Bs. 211.187,50";s:11:"post_status";s:7:"publish";s:14:"comment_status";s:4:"open";s:11:"ping_status";s:6:"closed";s:13:"post_password";s:0:"";s:9:"post_name";s:20:"matrimonial-colonial";s:7:"to_ping";s:0:"";s:6:"pinged";s:0:"";s:13:"post_modified";s:19:"2018-04-06 22:42:47";s:17:"post_modified_gmt";s:19:"2018-04-06 22:42:47";s:21:"post_content_filtered";s:0:"";s:11:"post_parent";i:0;s:4:"guid";s:65:"http://latruchaazul.com.ve/wp/producto/import-placeholder-for-53/";s:10:"menu_order";i:2;s:9:"post_type";s:7:"product";s:14:"post_mime_type";s:0:"";s:13:"comment_count";s:1:"0";s:6:"filter";s:3:"raw";}i:1;O:7:"WP_Post":24:{s:2:"ID";i:58;s:11:"post_author";s:1:"1";s:9:"post_date";s:19:"2017-10-03 11:10:36";s:13:"post_date_gmt";s:19:"2017-10-03 11:10:36";s:12:"post_content";s:767:"Amplia y moderna habitaci?n, ubicada en nuestro nuevo Edificio, delicadamente decorada con detalle