(3863, '_transient_0f9dee6c986c475b4bbae6e42d92a9c2_version_data', 'a:4:{s:4:"date";s:4:"2018";s:7:"version";s:7:"1.10.12";s:6:"update";s:61:"Fix    - Added fourth arg in Confirmation emails for actions.";s:9:"changelog";a:6:{s:7:"headers";O:42:"Requests_Utility_CaseInsensitiveDictionary":1:{s:7:"\0*\0data";a:11:{s:12:"content-type";s:10:"text/plain";s:14:"content-length";s:5:"42576";s:4:"date";s:29:"Thu, 01 Mar 2018 17:12:28 GMT";s:13:"last-modified";s:29:"Fri, 02 Feb 2018 07:14:14 GMT";s:4:"etag";s:34:""a410f4f97e7179534cf9c001b147a1e4"";s:13:"accept-ranges";s:5:"bytes";s:6:"server";s:8:"AmazonS3";s:3:"age";s:5:"67192";s:7:"x-cache";s:19:"Hit from cloudfront";s:3:"via";s:64:"1.1 c62f6c9a9fdf2356a904a1b156a05fe1.cloudfront.net (CloudFront)";s:11:"x-amz-cf-id";s:56:"BngNqLwqEGpvaejf5FVrTEXAbpRyOXcW5xENLVs1Wdftqols5HS0Fg==";}}s:4:"body";s:42576:"*** WooCommerce Bookings Changelog ***\n\n2018-01-31 - version 1.10.12\n* Fix    - Added fourth arg in Confirmation emails for actions.\n* New    - Bookings data included in WooCommerce core import and export functionality.\n* Add    - Added compatibility for Sequential Order Numbers Pro\n* Fix    - Slots available after max available time.\n* Fix    - Double check product exists before attempting to get_title().\n\n2017-12-14 - version 1.10.11\n* Fix    - Order metadata not being synced with Google Calendar sync.\n* Fix    - Deposit integration parent order not marked as completed when it contains a booking.\n* Fix    - Failed order''s related bookings is never cancelled.\n* Update - Bump tested version to 3.3\n\n2017-12-05 - version 1.10.10\n* Fix   - Bookings overwriting notes made directly on Google Calendar on subsquent syncs.\n* Fix   - wc_bookings_calendar_default_to_current_date filter not working when using availability rules\n* Fix   - Customer defined blocks by hour durations buffering by incorrect amounts.\n* Fix   - Remove activation notice when plugin is deactivated.\n* Fix   - Global and product rule not overriding resource rules when calling get_blocks_in_range directly\n* Fix   - Incorrect remaining count on blocks when resources overlap and are set to automatically assigned.\n\n2017-11-01 - version 1.10.9\n* Add   - Allow price overriding for all Bookings by adding equals operator in the costs range.\n* Add   - Include number of persons in Booking Calendar Monthly view and Daily view.\n* Fix   - Resource dropdown should only display the costs related to the resource.\n* Fix   - Prevent deleting products or resources that have bookings associated with them.\n* Fix   - "Booked By" column is empty if there''s no email address specified for the customer.\n* Fix   - Restrict Days not working when site is translated.\n* Fix   - Incorrect remaining count on blocks when resources overlap.\n* Fix   - Calendar not defaulting to first available date with shared resource.\n* Tweak - Add CSS class to the first and the last date in the bookable-range.\n* Tweak - Clearer text when customer selects a range of dates.\n* Tweak - Add Onboarding notice.\n* Tweak - Calendar page title.\n* Tweak - Improve error feedback on calendar timepicker.\n* Tweak - Input time fields when editing existing booking should be of type "time".\n* Tweak - Change "Create Booking" to "Add Booking".\n* Tweak - Rename `base_cost` methods to `block_cost` on bookable products to reflect the proper fields.\n* Tweak - Update sanity check notices to be warnings.\n\n2017-09-21 - version 1.10.8\n* Fix   - Customer cancelled bookings were not triggering cancellation emails.\n* Fix   - Incorrect text domain for translation.\n* Fix   - Incorrect links for docs and support.\n* Fix   - Bookings Calendar not functioning properly for RTL languages.\n* Fix   - Random availability problem.\n* Fix   - Calendar calculation wasn''t taking into consideration days before actual booking for duration of type days.\n* Fix   - Data manipulation allows bookings outside of defined blocks.\n* Fix   - Orders with multiple cancelled bookings still show as "Completed".\n* Fix   - PHP notice when adding bookable product that requires confirmation to the cart.\n* Tweak - Pagination of "My Bookings".\n* Tweak - Switch order of operations for `status_transitioned_handler`.\n* Tweak - Time in admin calendar day view now uses WordPress time format.\n* Tweak - Updated templates to have proper/updated headers.\n\n2017-08-17 - version 1.10.7\n* Add   - New functionality to restrict the day a booking can start on. \n* Fix   - Admin calendar day view incorrect when times below 10am.\n* Fix   - Bookings calendar on the backend doesn''t respect time format in WordPress settings.\n* Fix   - Bookings with orders created in admin had totals without taxes included.\n* Fix   - Fatal error when using woocommerce_email_recipient_booking_confirmed\n* Fix   - Fatal if create_wc_booking used to create booking based on parent.\n* Fix   - Hour based slots overlapping midnight marks next day as partially booked even though it doesn''t affect any of the slots.\n* Fix   - My Account > Bookings default order to booking date instead of date created.\n* Fix   - Refunded orders will update the Bookings status to Refunded.\n* Fix   - Today''s availability rules were being ignored.\n* Tweak - Added filter for wc_bookings_get_time_slots_html.\n* Tweak - Added filters to allow switching to date created for My Account > Bookings.\n* Tweak - Added wc_bookings_summary_list_date filter for wc_bookings_get_summary_list.\n* Tweak - Automatically open calendar when clicking on any of the Month/Day/Year input boxes.\n* Tweak - Moved Booking Display to templates for orders on both front-end and admin.\n* Tweak - Moved Booking Summary list to templates for orders on both front-end and admin.\n* Tweak - Send confirmation email for manually created bookings without an order.\n\n2017-07-22 - version 1.10.6\n* Fix   - Error 500 when using external object cache, such as Memcached.\n* Fix   - Days with availability > 1 calendar shows fully booked after 1 booking.\n* Fix   - Emails are triggered when saving a booking and changes aren''t made.\n\n2017-07-19 - version 1.10.5\n* Fix   - Update WC 3.x compatibilities when duplicating product.\n* Fix   - Taxes not added when creating a booking from admin.\n* Fix   - Admin calendar time slots has the wrong sizes and start times.\n* Fix   - Resources display wrong sum of cost in frontend dropdown.\n* Fix   - Resources able to be added to product twice.\n* Fix   - Reminder and complete cron events not set if Booking is created without an order from the backend.\n* Fix   - Fatal error when bookings used with a cached objects.\n* Fix   - Email ID was the same for customer and admin booking cancelled email.\n* Fix   - All day booking option was being ignored on calendar after availability refactor.\n* Fix   - Missing utf8_encode function when no XML PHP module installed in google calendar integration.\n* Fix   - Availability rules using Date Range calculation on the frontend.\n* Fix   - "Connect with Google" does not save/update entries.\n* Fix   - Availability rules with dates in the past should be ignored for performance reasons.\n* Tweak - Add woocommerce_bookings_email_actions filter to allow additional Bookings emails.\n* Fix   - Audit usages of get_price / price filters for Memberships/Dynamic Discounts compatibility.\n* Fix   - Default price being used when price rules make price 0.\n* Tweak - Do not display ''View my bookings'' link if guest checkout used.\n* Fix   - Incorrect date being checked when getting time slots vs availability rules.\n* Fix   - Endless loop when auto completion of booking when it has no order.\n* Tweak - Re-introduce adjacent buffering option for Days.\n\n2017-06-29 - version 1.10.4\n* Fix   - Memberships discounts not working.\n* Fix   - Duplicating product creates multiple copies of meta fields.\n* Fix   - Fatal errors when applying bookable person coupons when other product types in cart.\n* Fix   - Deleting one booking deletes the whole order.\n* Fix   - Leftover bookings cron hooks after booking was deleted.\n* Add   - Is valid booking check to ''wc-booking-complete'' action.\n* Fix   - Only sync Google Calendar if the integration is configured.\n* Fix   - When a resource is attached, booking multiple days shows partials days when they are not.\n* Fix   - Base cost did not include resource cost unless there were persons.\n* Fix   - `/bookings/` slug always redirects to Blog page.\n* Fix   - Undefined offset when viewing order with persons added to the booking.\n* Fix   - All day booking option was being ignored when parsing bookings for calendar availability.\n* Fix   - Delete database entries on uninstall only in case `WC_REMOVE_ALL_DATA` is true.\n* Fix   - Manual POST request can bypass calendar validation.\n* Tweak - Update order status if booking status changes to paid or unpaid.\n* Tweak - Update maximum resource count indicator on calendar block.\n* Fix ? - Undefined variable notice for booking_persons when editing booking.\n* Fix ? - Issue where availability rules were not applied against duration calculation.\n* Tweak - Refactor `find_fully_booked_blocks` to be consistent with the time slots display.\n* Fix   - Not needed ''to'' label added for Date Range (Global Availability) when also Date Range with time is added.\n* Fix   - Virtual orders were being marked as processing after being marked as completed.\n* Tweak - Hide adjacent buffering option for Days, as it is not used for Days.\n* Fix   - During checkout with person type that has cost that equals 0 cart will default to person type with non 0 cost.\n\n2017-05-30 - version 1.10.3\n* Fix   - Display price is not changed on the front-end when updated in the back-end.\n* Fix   - Unlink person types from product instead of deleting them, to allow existing bookings to refer to them properly.\n* Add   - Option to remove unused person types under WooCommerce > Status > Tools.\n* Fix   - When resource/persons limit is hit the entire day is blocked, not just the hour.\n* Fix   - Skip persons with zero count for booking summary in emails and orders.\n* Fix   - Resources ranges not exluding times from bookable products.\n* Fix   - Admin day calendar view showing wrong time for bookings spanning multiple days.\n* Fix   - Price shows as Free even though person types have value.\n* Fix   - Display Cost does not display From in all cases.\n* Add   - Option to take WP TimeZone into consideration for `wc-booking-reminder` and `wc-booking-complete` scheduled events.\n* Fix   - Coupon updates for WC 3.0 compatibility.\n* Fix   - Bookings spanning 2+ days shows up as being booked the day before on admin Day View calendar.\n* Tweak - Update booking summary in order and emails to only display single day/time if booking starts/ends on same day.\n\n2017-05-11 - version 1.10.2\n* Fix   - Booked shared resource blocks off availability for other products.\n* Fix   - Issue where persons number disappears during booking process.\n* Fix   - UI issue with the CSS classes for partial/fully booked in the case of automatic resource assignment.\n* Fix   - Trashing a booking will no longer trash its order if order has other items.\n* Fix   - Compatibility issue with Product Add-Ons integrations.\n* Fix   - Update compatibility with Deposits when the status of the order is ''Partially Paid''.\n* Fix   - Blank description on Google Calendar.\n* Fix   - Booking with persons and resources availability incorrect.\n* Fix   - Issue with availability spanning midnight.\n* Fix   - Issue with Booking with multiple resources showing booked days as available.\n\n2017-04-20 - version 1.10.1\n* Fix   - Error when deleting product on admin.\n* Fix   - Persons not showing up in the Edit Booking page.\n* Fix   - Negative values of available quantity.\n* Fix   - Reset email data for each trigger to not send previously calculated data.\n* Fix   - Make buffers apply in front by shifting times accordingly.\n* Fix   - Logic for available times where some